            account: "0x17612A043C6F48CdE4AB95Bbf3710Ce11BAbd66c"},
            { name : "Bệnh viện nội tiết trung ương",
            account: "0x0a88BAa64ea54a3257C76170791E70d06D869FD2"}
        ]
    })
    }


    tranferPatient=(account,name)=>{
let a = confirm("You definitely moved to" + name + "?")

    }

  render() {
    return (
        <div>
      Bệnh viện :
      <ul>
          {
              this.state.hospitalData.map((data)=>
              <li>
                  <a onClick={event=>this.tranferPatient(data.account,data.name)}>{data.name}</a>
                  <p2>{data.account}</p2>
              </li>
              )
          }

      </ul>

         </div>
    )
  }
}

export default Hospital;
